	add("incest", "{\"term\":\"incest\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027incestus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Sexual relations between close relatives, especially immediate family members and first cousins, usually considered taboo; in many jurisdictions, close relatives are not allowed to marry, and incest is a crime\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Genetic problems caused by \u0027\u0027incest\u0027\u0027 are thought to have plagued many royal families in the Middle Ages\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, George R. R. Martin, \u0027A Feast for Crows: A Song of Ice and Fire\u0027, page 225\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He was only Craster\u0027s whelp, an abomination born of \u0027\u0027incest\u0027\u0027, not the son of the King-beyond-the-Wall\", \"priority\":4}]}, \"synonyms\":{}}");

	add("inchastity", "{\"term\":\"inchastity\", \"etymology\":{\"influencers\":[], \"languages\":[\"French\"], \"text\":\"{{prefix|in|chastity|lang\u003den}}: compare French \u0027inchasteté\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Absence of chastity; the quality of being unchaste\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Gillian Cloke, \u0027This Female Man of God: Women and Spiritual Power in the Patristic Age, 350–450 AD\u0027, Routledge, ISBN 9781134868254, [https://books.google.com/books?id\u003dKCGIAgAAQBAJ\u0026amp;lpg\u003dPA66\u0026amp;dq\u003d%22inchastity%22\u0026amp;pg\u003dPA6\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22inchastity%22\u0026amp;f\u003dfalse p.\u0026amp;nbsp;66\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In pre-Christian Roman belief it might be held as better not to indulge in extramarital sex, as a courtesy more than a due to one’s partner, or because character was believed to derive from having the strength to resist vice but, such rationalisations aside, male \u0027\u0027inchastity\u0027\u0027 did not \u0027matter\u0027 as such. Female \u0027\u0027inchastity\u0027\u0027 could threaten bloodlines and property transfer, and so from the earliest times very much did matter: in fact, Chrysostom refutes in detail the legal position that only women’s \u0027\u0027inchastity\u0027\u0027 signified in marriage, in a passage so full of reproach and repetition that we may infer that he too is meeting a dead weight of inertia, if not active opposition, from his hearers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Eleanor Cashin-Ritaine, Laetitia Franck, Shaheeza Lalani (eds.), \u0027Legal Engineering and Comparative Law/L’ingénierie juridique et le droit comparé\u0027, Schulthess, ISBN 9783725557141, [https://books.google.com/books?id\u003d8zU6AQAAIAAJ\u0026amp;q\u003d%22inchastity%22\u0026amp;dq\u003d%22inchastity%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\u003dy p.\u0026amp;nbsp;199\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The relevant Qur’anic verse (\u0027Ayât\u0027) is very similar to the English law on slander \u0027per se\u0027 and the imputation of \u0027\u0027inchastity\u0027\u0027 for women\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Tom MacFaul, \u0027Problem Fathers in Shakespeare and Renaissance Drama\u0027, Cambridge University Press, ISBN 9781139789844, [https://books.google.com/books?id\u003dfYohAwAAQBAJ\u0026amp;lpg\u003dPA207\u0026amp;dq\u003d%22inchastity%22\u0026amp;pg\u003dPA20\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22inchastity%22\u0026amp;f\u003dfalse p.\u0026amp;nbsp;207\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Having found out about the wife’s \u0027\u0027inchastity\u0027\u0027, Geraldine does not need his father’s exhortations to stay away from Wincott’s house. He rebukes the wife for her \u0027\u0027inchastity\u0027\u0027 – and she dies of shame, conveniently leaving a letter of confession\", \"priority\":9}]}, \"synonyms\":{}}");

