	add("incontinence", "{\"term\":\"incontinence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027incontinence\u0027 from Latin \u0027incontinentia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Lack of self-restraint, an inability to control oneself; unchastity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027, Henry Fielding, \u0027Tom Jones\u0027, Folio Society 1973, p. 119\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Allworthy was sufficiently offended by this transgression of Jones; for notwithstanding the assertions of Mr Western, it is certain this worthy man had never indulged himself in any loose pleasures with women, and greatly condemned the vice of \u0027\u0027incontinence\u0027\u0027 in others\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The inability of any of the physical organs to restrain discharges of their contents; involuntary discharge or evacuation (of urine or feces\", \"priority\":4}]}, \"synonyms\":{}}");

