	add("incorporation", "{\"term\":\"incorporation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"From Middle english (1100-1500) \u0027incorporacioun\u0027 from Old french (842-ca. 1400) \u0027incorporacion\u0027 from \u0027incorporatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of incorporating, or the state of being incorporated\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The union of different ingredients in one mass; mixture; combination; synthesis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The union of something with a body already existing; association; intimate union; assimilation; as, the incorporation of conquered countries into the Roman republic\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of creating a corporation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A body incorporated; a corporation\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A phenomenon by which a grammatical category forms a compound with its direct object or adverbial modifier, while retaining its original syntactic function\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Incorporation\u0027\u0027 is central to many polysynthetic languages such as those found in North America, Siberia and northern Australia\", \"priority\":7}]}, \"synonyms\":{}}");

