	add("incredulity", "{\"term\":\"incredulity\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Attested since 1430. From Old french (842-ca. 1400) \u0027incredulité\u0027 from Latin \u0027incredulitas\u0027 from \u0027incredulus\u0027 (unbelieving) + \u0027-itas\u0027 (-ity)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Unwillingness or inability to believe; doubt about the truth or verisimilitude of something; disbelief\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1916\u0027\u0027, Edgar Rice Burroughs, \u0027Tarzan and the Jewels of Opar\u0027, ch. 24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Wide went her eyes in wonder and \u0027\u0027incredulity\u0027\u0027, as she beheld this seeming apparition risen from the dead\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d8|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dIt was a casual sneer, obviously one of a long line. There was hatred behind it, but of a quiet, chronic type, nothing new or unduly virulent, and he was taken aback by the flicker of amazed \u0027\u0027incredulity\u0027\u0027 that passed over the younger man\u0027s ravaged face\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Religious disbelief, lack of faith\", \"priority\":5}]}, \"synonyms\":{}}");

	add("incremence", "{\"term\":\"incremence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Alteration of the noun of action \u0027increment\u0027 to form a noun of quality, on the pattern of \u0027incidence\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Incremental growth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1864\u0027\u0027: T. Irwin, \u0027The Last Sibyl\u0027, in \u0027The Dublin University Magazine: A Literary and Political Journal\u0027, volume 64, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dPAr7i_RGDbAC\u0026amp;pg\u003dPA202\u0026amp;dq\u003d%22incremence%22\u0026amp;ei\u003dzqCSSpiIKIOSNviglKs\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22incremence%22\u0026amp;f\u003dfalse pages 201–202]\u0026lt;/span\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An aged earth in ruins, and a new\u0026lt;br/\u0026gt;World of barbaric nature in the west\u0026lt;br/\u0026gt;Discovered, and in European lands\u0026lt;br/\u0026gt;The great mind-harvest growing more and more\u0026lt;br/\u0026gt;With ardent \u0027\u0027incremence\u0027\u0027. Yet still this earth\u0026lt;br/\u0026gt;Is but a crescent sphere, half lit with dawn\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1928\u0027\u0027: \u0027Congressional Serial Set\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dDStUAAAAIAAJ\u0026amp;q\u003d%22incremence%22\u0026amp;dq\u003d%22incremence%22\u0026amp;ei\u003dzqCSSpiIKIOSNviglKsH page 109]\u0026lt;/span\u0026gt; (United States Government Printing Office\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"This work is being carried on by annual increments of $300000, as part of the five-year program, and as successive \u0027\u0027incremence\u0027\u0027 of funds become available the construction most urgently needed is undertaken during that year\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027: Egon Diczfalusy (editor), \u0027Immunoassay of gonadotrophins: Karolinska Symposia on Research Methods in Reproductive Endocrinology. Transactions of the first Symposium held in Stockholm on September 23–25, 1969\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003d0RVrAAAAMAAJ\u0026amp;q\u003d%22incremence%22\u0026amp;dq\u003d%22incremence%22\u0026amp;ei\u003dzqCSSpiIKIOSNviglKsH page 358]\u0026lt;/span\u0026gt; (Periodica\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"If you give a small glucose load to 30 different people and do not allow for the fact that their basal blood sugars are all different, you may not see a significant rise in the mean blood sugar. Have you corrected your curves and tried to do these plots in terms of \u0027\u0027incremence\u0027\u0027 and decremence from some starting point\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027: Ronald R. Yager and Lotfi Asker Zadeh, \u0027Fuzzy Sets, Neural Networks, and Soft Computing\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dG69QAAAAMAAJ\u0026amp;q\u003d%22incremence%22\u0026amp;dq\u003d%22incremence%22\u0026amp;ei\u003dzqCSSpiIKIOSNviglKsH page 252]\u0026lt;/span\u0026gt; (2nd Ed.; Van Nostrand Reinhold; ISBN 0442016212, 9780442016210\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"When dealing with values in the unit interval we expect the speed of \u0027\u0027incremence\u0027\u0027 to slow down the closer we come to maximal belief\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Incremental rate\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027: \u0027Merger of Naval Supply Activities in the San Pedro-Long Beach Area: Hearing Before a Subcommittee of the Committee on Government Operations, House of Representatives, Eighty-fourth Congress, First Session. September 15, 1955\u0027, issue 22, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dnTNtAAAAMAAJ\u0026amp;q\u003d%22incremence%22\u0026amp;dq\u003d%22incremence%22\u0026amp;ei\u003dzqCSSpiIKIOSNviglKsH page 105] \u0026lt;sup\u0026gt;[http://books.google.co.uk/books?id\u003dbz6ri-RDNCsC\u0026amp;q\u003d%22incremence%22\u0026amp;dq\u003d%22incremence%22\u0026amp;ei\u003dzqCSSpiIKIOSNviglKsH 〃]\u0026lt;/sup\u0026gt;\u0026lt;/span\u0026gt; (United States Government Printing Office\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The Navy has programed\u0026lt;!-- [sic] --\u0026gt; over an \u0027\u0027incremence\u0027\u0027 of 3 or 4 fiscal years, corrective measures in dikes and walls to protect their investment in this shipyard\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Division into increments\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027: Françoise Fogelman-Soulié (editor) and Patrick Gallinari (editor), \u0027Industrial Applications of Neural Networks\u0027, \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003dqWvsVQVeFo0C\u0026amp;pg\u003dPA429\u0026amp;dq\u003d%22incremence%22\u0026amp;ei\u003dzqCSSpiIKIOSNviglKs\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22incremence%22\u0026amp;f\u003dfalse page 429] ([http://www.worldscibooks.com/engineering/3510.html World Scientific]\u0026lt;/span\u0026gt;; ISBN 9789810231750, 981023175X\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The \u0027generalized preprocessing perceptron\u0027, ¹ as a function from [0, 1] ⁿ to \u0027R\u0027 can be written as \u0027y\u0027 \u003d \u0026lt;sup\u0026gt;n\u0026lt;/sup\u0026gt;\u0026lt;sub style\u003d\u0026quot;margin-left:-1ex;\u0026quot;\u0026gt;\u0026lt;i\u0026gt;i\u0026lt;/i\u0026gt;\u003d1\u0026lt;i\u0026gt;i\u0026lt;/i\u0026gt;\u0026lt;/sub\u0026gt;(\u0026lt;i\u0026gt;w\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;, g\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;\u0026lt;/i\u0026gt; (\u0026lt;i\u0026gt;x\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;\u0026lt;/i\u0026gt;)) where \u0026lt;i\u0026gt;x\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;\u0026lt;/i\u0026gt; are the inputs, \u0026lt;i\u0026gt;g\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;\u0026lt;/i\u0026gt; is in the preprocessing layer, \u0026lt;i\u0026gt;w\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;\u0026lt;/i\u0026gt; represents the uncertainty for the conclusion from \u0026lt;i\u0026gt;x\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;\u0026lt;/i\u0026gt; to the output \u0027y\u0027, \u0026lt;i\u0026gt;\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;\u0026lt;/i\u0026gt; (\u0026lt;i\u0026gt;w\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;, s\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;\u0026lt;/i\u0026gt;) represents the semantics of implication \u0026lt;i\u0026gt;x\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;\u0026lt;/i\u0026gt; →\u0026lt;i\u0026gt;\u0026lt;sub\u0026gt;w\u0026lt;sub\u0026gt;i\u0026lt;/sub\u0026gt;\u0026lt;/sub\u0026gt;\u0026lt;/i\u0026gt; \u0027y\u0027, and corresponds to a logical disjunction that calculates an \u0027\u0027incremence\u0027\u0027 of evidence. Typically, has a greater function, and is an assembly of co-\u0027t\u0027-norms\", \"priority\":17}]}, \"synonyms\":{}}");

	add("incrementation", "{\"term\":\"incrementation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of incrementing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("incus", "{\"term\":\"incus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|incūs||anvil}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small anvil-shaped bone in the middle ear\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Elaine N. Marieb \u0026amp; Katja Hoehn, \u0027Human Anatomy \u0026amp; Physiology\u0027, 8th edition, page 57\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The tympanic cavity is spanned by the three smallest bones in the body: the auditory ossicles These bones, named for their shape, are the malleus (malʹe-us; \u0026quot;hammer\u0026quot;); the \u0027\u0027incus\u0027\u0027 (ingʹkus; \u0026quot;anvil\u0026quot;); and the stapes (staʹpēz; \u0026quot;stirrup\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"an accessory cloud, in the shape of an anvil which forms by spreading at the top of a cumulonimbus\", \"priority\":4}]}, \"synonyms\":{}}");

	add("incubation", "{\"term\":\"incubation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027incubationem\u0027 from \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Sitting on eggs for the purpose of hatching young; a brooding on, or keeping warm, to develop the life within, by any process\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The development of a disease from its causes, or its period of incubation. (See below\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A period of little reaction which is followed by more rapid reaction\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Sleeping in a temple or other holy place in order to have oracular dreams\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, Benjamin Walker, \u0027Encyclopedia of Metaphysical Medicine\u0027, Routledge 1978, p. 144\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Incubation\u0027\u0027 in the vicinity of burial places, cremation grounds, holy wells and sacred streams was common. The ancient Hebrews visited vaults or slept among tombs to get meaningful dreams\", \"priority\":6}]}, \"synonyms\":{}}");

	add("incubator", "{\"term\":\"incubator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|incubate|ator|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any apparatus used to maintain environmental conditions suitable for a reaction\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An apparatus used to maintain environmental conditions suitable for a newborn baby\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An apparatus used to maintain environmental conditions suitable for the hatching of eggs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A place to maintain the culturing of bacteria at a steady temperature\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A support programme for the development of entrepreneurial companies\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Philip N. Cooke, \u0027Creative Industries in Wales: Potential and Pitfalls\u0027 (page 34\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"So the question that is commonly asked is, why put a media \u0027\u0027incubator\u0027\u0027 in a media desert and have it managed by a civil servant? This gets to the heart of the institutional support problem in Wales\", \"priority\":7}]}, \"synonyms\":{}}");

