	add("incumbrance", "{\"term\":\"incumbrance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027encombrance\u0027 from \u0027encombrer\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A burden; a thing that must be carried\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an interest, right, burden, or liability attached to a title of land, such as a lien or mortgage\", \"priority\":2}]}, \"synonyms\":{}}");

	add("incunable", "{\"term\":\"incunable\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027incunable\u0027 from Latin \u0027incunabula\u0027 (swaddling-clothes, cradle) Compare incunabulum.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very early printed book, specifically one printed before 1501; an incunabulum\", \"priority\":1}]}, \"synonyms\":{}}");

	add("incunabulum", "{\"term\":\"incunabulum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027incūnābulum\u0027 (cradle, origin)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A book, single sheet, or image that was printed — not handwritten — before the year 1501 in Europe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004,\u0027\u0027 Luisa Graves (translator), Carlos Ruiz Zafón (author), \u0027The Shadow of the Wind\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something about him reminded me of one of those figures from old-fashioned playing cards or the sort used by fortune-tellers, a print straight from the pages of an \u0027\u0027incunabulum\u0027\u0027: his presence was both funereal and incandescent, like a curse dressed in its Sunday best\", \"priority\":3}]}, \"synonyms\":{}}");

	add("incurability", "{\"term\":\"incurability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|incurable|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being incurable—not being able to be cured\", \"priority\":1}]}, \"synonyms\":{}}");

	add("incurableness", "{\"term\":\"incurableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|incurable|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the state or condition of being incurable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("incuriosity", "{\"term\":\"incuriosity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|incurious|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of lacking curiosit\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"have sometimes tried to claim\", \"priority\":2}]}, \"synonyms\":{}}");

